const App: React.FC = () => {
  const [size, setSize] = useState<number>(160);

  const increase = () => {
    setSize((prevSize) => {
      const newSize = prevSize + 10;
      if (newSize > 300) {
        return 300;
      }
      return newSize;
    });
  };

  const decline = () => {
    setSize((prevSize) => {
      const newSize = prevSize - 10;
      if (newSize < 48) {
        return 48;
      }
      return newSize;
    });
  };

  return (
    <>
      <ButtonGroup style={{ marginBottom: 16 }}>
        <Button
          onClick={decline}
          disabled={size <= 48}
          icon={<AttributeArrowRegular />}
        >
          Smaller
        </Button>
        <Button onClick={increase} disabled={size >= 300} icon={<Add />}>
          Larger
        </Button>
      </ButtonGroup>
      <QRCode
        errorLevel="H"
        size={size}
        iconSize={size / 4}
        value="https://datlas.maicedata-staging.com/statics/metro-design-doc/"
        icon="https://nickjiangdev.github.io/metro-docs/mds-logo.svg"
      />
    </>
  );
};

export default App;
